import { Component } from '@angular/core';

@Component({
  selector: 'app-contacts-page',
  templateUrl: './contacts-page.component.html',
  styleUrls: ['./contacts-page.component.sass']
})
export class ContactsPageComponent {

}
<!DOCTYPE html>
<html>

<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>KPI ім. Ігоря Сікорського</title>
  <style>
    html {
      line-height: 1.15;
      -webkit-text-size-adjust: 100%;
    }

    body {
      display: block;
      margin: 0;
      background-image: url(../../../assets/img/contacts-page-img/5.jpg);
      background-repeat: no-repeat;
      background-position: center;
      background-size: cover;
    }

    .container {
      display: flex;
    }

    .container .left {
      flex: 1;
      background: rgba(0, 0, 0, 0.43);
      filter: blur(2px);
      border-radius: 10px;
      width: 588px;
      height: 761px;
      margin-top: 142px;
      left: 122px;
    }

    .container .right {
      flex: 1;
      background: rgba(0, 0, 0, 0.43);
      filter: blur(2px);
      border-radius: 10px;
      width: 466px;
      height: 513px;
      margin-top: 256px;
      left: 852px;
    }
    .left_title{
      display: block;
      margin-bottom: 20px;
      font-family: "Montserrat";
      font-size: 44px;
      line-height: normal;
      font-weight: 600;
      color: #ffffff;
    }
  </style>
</head>

<body>
<main>
  <div class="container">
    <div class="left">
      <p class="left_title">Зв'яжіться з нами</p>
    </div>
    <div class="right">
      <!-- Вміст другого контейнера -->
    </div>
  </div>
</main>
<footer>

</footer>
</body>

</html>
